patch:
--- include-refactoring/xsimd/config/xsimd_arch.hpp
@@ -91,7 +91,7 @@ namespace xsimd {
         : join<typename Arch::template extend<Archs...>, Args...> {};
   } // namespace detail

-  using all_x86_architectures = arch_list<avx512f, fma5, avx2, /*xop, fma4,*/ avx, fma3, sse4_2, sse4_1, /*sse4a,*/ ssse3, sse3, sse2, sse>;
+  using all_x86_architectures = arch_list<avx512bw, avx512f, fma5, avx2, /*xop, fma4,*/ avx, fma3, sse4_2, sse4_1, /*sse4a,*/ ssse3, sse3, sse2, sse>;
   //using all_arm_architectures = arch_list<neon64, neon>;
   using all_architectures = typename detail::join</*all_arm_architectures,*/ all_x86_architectures>::type;

--- include-refactoring/xsimd/config/xsimd_cpuid.hpp
@@ -24,7 +24,8 @@ namespace xsimd {
         unsigned xop : 1;
         unsigned avx : 1;
         unsigned avx2 : 1;
-        unsigned avx512 : 1;
+        unsigned avx512f : 1;
+        unsigned avx512bw : 1;
         unsigned neon : 1;
         unsigned neon64 : 1;

@@ -117,8 +118,11 @@ namespace xsimd {
              avx2 = regs[1] >> 5 & 1;
              best = std::max(best, avx2::version() * avx2);

-             avx512 = regs[1] >> 16 & 1; // actually avx512f
-             best = std::max(best, avx512f::version() * avx512);
+             avx512f = regs[1] >> 16 & 1;
+             best = std::max(best, avx512f::version() * avx512f);
+
+             avx512bw = regs[1] >> 30 & 1;
+             best = std::max(best, avx512bw::version() * avx512bw);

              //get_cpuid(regs, 0x80000001);
              //fma4 = regs[2] >> 16 & 1;
